# Analyzing Responder Behavior in Contribution-Based Ultimatum Game

Let me think through this step by step to design a computational model for responder behavior in this modified ultimatum game where contributions vary.

## Key Psychological Mechanisms

1. **Fairness Perception**: People typically have preferences for fair outcomes, especially in economic games.

2. **Contribution-Based Fairness**: Unlike typical ultimatum games, here fairness may be judged relative to initial contributions (tokens found).

3. **Absolute vs. Relative Gains**: Responders likely care about both their absolute monetary gain and the relative proportion of the total.

4. **Social Comparison**: People may compare their outcome to their opponent's outcome.

5. **Minimal Acceptability Threshold**: Responders might have a minimum amount they're willing to accept regardless of fairness.

## Potential Model Approach

Looking at the previous model, it already captures fairness deviation from contribution-based fairness. Let me explore a different approach focusing on inequity aversion with a reference point based on contributions.

In this approach, I'll model the utility of accepting an offer as a function of:
1. The absolute monetary gain (split_self)
2. The inequality between what the responder receives compared to what they contributed

## Mathematical Form

I'll build a model where utility is:
1. Positively related to the amount offered (split_self)
2. Negatively related to the deviation from equity based on contributions

For a simple 2-parameter model, I can use one parameter to weight the importance of equity relative to absolute gain, and another to determine how the responder evaluates equity (linear vs. non-linear).

<MODEL>
relative_contribution = token_self / (token_self + token_opp)
expected_share = relative_contribution * combined_earning
normalized_deviation = (split_self - expected_share) / combined_earning
U = split_self + alpha * sign(normalized_deviation) * abs(normalized_deviation)^beta
</MODEL>

<VARIABLES>
{
  "variables": {
    "U": {
      "description": "Utility of accepting the proposed offer",
      "range": {
        "min": "-inf",
        "max": "inf"
      },
      "learnable": false,
      "source": "calculated"
    },
    "relative_contribution": {
      "description": "Proportion of tokens contributed by the participant",
      "range": {
        "min": 0,
        "max": 1
      },
      "learnable": false,
      "source": "calculated"
    },
    "expected_share": {
      "description": "Amount the participant might expect based on relative contribution",
      "range": {
        "min": 0,
        "max": "inf"
      },
      "learnable": false,
      "source": "calculated"
    },
    "normalized_deviation": {
      "description": "Deviation from expected share normalized by total earnings",
      "range": {
        "min": -1,
        "max": 1
      },
      "learnable": false,
      "source": "calculated"
    },
    "split_self": {
      "description": "Amount offered to the participant",
      "range": {
        "min": 0,
        "max": "inf"
      },
      "learnable": false,
      "source": "data"
    },
    "token_self": {
      "description": "Number of tokens found by the participant",
      "range": {
        "min": 0,
        "max": "inf"
      },
      "learnable": false,
      "source": "data"
    },
    "token_opp": {
      "description": "Number of tokens found by the opponent",
      "range": {
        "min": 0,
        "max": "inf"
      },
      "learnable": false,
      "source": "data"
    },
    "combined_earning": {
      "description": "Total amount earned by both participants",
      "range": {
        "min": 0,
        "max": "inf"
      },
      "learnable": false,
      "source": "data"
    },
    "alpha": {
      "description": "Weight given to fairness concerns relative to absolute monetary gain",
      "range": {
        "min": -100,
        "max": 100
      },
      "learnable": true,
      "source": "learnable"
    },
    "beta": {
      "description": "Shape parameter determining sensitivity to deviations from expected share",
      "range": {
        "min": 0.1,
        "max": 5
      },
      "learnable": true,
      "source": "learnable"
    }
  }
}
</VARIABLES>

<SUMMARY>
A non-linear inequity aversion model where utility depends on both absolute monetary gain and fairness relative to contributions. The model calculates an expected share based on the proportion of tokens contributed, then evaluates offers against this reference point. The utility combines the absolute offer amount with a non-linear term for normalized fairness deviation. Two parameters control this process: alpha determines the weight of fairness concerns (negative values indicate aversion to receiving more than deserved), while beta controls the shape of sensitivity to deviations (values above 1 indicate increasing sensitivity to larger deviations).
</SUMMARY>

